import React from "react";
import "../stylesheets/App.scss";
import "../stylesheets/ClubList.scss";
import "../stylesheets/Club.scss";
import clubs from "../data/clubs.json";

const App = () => {
  return (
    <div className="App">
      <ul className="list">
        {clubs.map((eachClub) => {
          return (
            <li className="list__item">
              <i className={eachClub.fa} />
              <div>
                <h2 className="item__title">{eachClub.name}</h2> Members:
                <li>{eachClub.members.join(" , ")}</li>{" "}
              </div>
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default App;
